import React from 'react'
import card from "../assets/weddingcard.webp"

const Home = ()=>{
  return(
    <section className='w-full h-[100vh] container'>
      <div className='obj'>
        <img src={card} alt="card" />
      </div>
    </section>
  )
}

export default Home
